script: |
  super -f text -I q6571.spq | sort > q6571.out

inputs:
  - name: q6571.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 NOT BETWEEN NULL AND - col2 OR NOT - col0 + - + ( 71 ) >= ( + col1 + 49 );
  - name: tab1

outputs:
  - name: q6571.out
    data: |
      51	14	96
      85	5	59
      91	47	68
